import React from 'react'
import {Link} from 'react-router-dom'

function HomeContact() {
  return (
      <div style={{
        backgroundSize: "cover",
        backgroundPosition: "center center",
          backgroundImage: `url("./images/contacthome.jpg")`,
        height: "448px"
      }}>
          <button>
              <Link>
                Contact Us
              </Link>

          </button>

    </div>
  )
}

export default HomeContact
